NextDC (stylized as NEXTDC) is an Australian [[data centre]] operator. {{As of|2020|July}}, the company operates 11 data centres around Australia,<ref name=":0">{{Cite web|last=Hastie|first=Hamish|date=31 July 2020|title=Internet has a new home in WA with opening of $200 million data tower|url=https://www.watoday.com.au/national/western-australia/internet-has-a-new-home-in-wa-with-opening-of-200-million-data-tower-20200731-p55hb3.html|url-status=live|archive-url=https://web.archive.org/web/20201224103213/https://www.watoday.com.au/national/western-australia/internet-has-a-new-home-in-wa-with-opening-of-200-million-data-tower-20200731-p55hb3.html|archive-date=24 December 2020|access-date=24 December 2020|website=[[WAtoday]]|language=en}}</ref> with facilities in [[Melbourne]], [[Sydney]], [[Brisbane]], [[Perth]] and [[Canberra]].
